import React from "react";
import ProfessorGraph from "./Components/ProfessorGraph";
import "./App.css";

function App() {

  const data = {
    "nodes": [
      { "id": "Professor Arti", "group": 0 },
      { "id": "Professor A", "group": 1 },
      { "id": "Professor B", "group": 1 },
      { "id": "Professor C", "group": 1 },
      { "id": "Course 101", "group": 2 },
      { "id": "Course 102", "group": 2 },
      { "id": "Course 103", "group": 2 },
      { "id": "Course 104", "group": 2 }
    ],
    "links": [
      { "source": "Professor Arti", "target": "Professor A", "value": 2 },
      { "source": "Professor Arti", "target": "Professor B", "value": 2 },
      { "source": "Professor Arti", "target": "Professor C", "value": 2 },
      { "source": "Professor A", "target": "Course 101", "value": 1 },
      { "source": "Professor A", "target": "Course 102", "value": 1 },
      { "source": "Professor B", "target": "Course 102", "value": 1 },
      { "source": "Professor B", "target": "Course 103", "value": 1 },
      { "source": "Professor C", "target": "Course 104", "value": 1 }
    ]
  }



  return (
    <div>
      <h1 className="h1">Professor Arti Graph View</h1>
      {/* <GraphView /> */}
      <ProfessorGraph data={data} ></ProfessorGraph>
    </div>
  );
}

export default App;
